(1, 1, 7, '[\"living-room\"]', 'Premium Oak Queen/King Sized Bed', 'premium-oak-queenking-sized-bed', 'A beautifully crafted Queen/King Sized Bed made from premium Particle Board with Laminate. This Premium Oak Queen/King Sized Bed features excellent craftsmanship and durability, perfect for any home. Designed with both style and functionality in mind, it will enhance your living space while providing years of reliable service.', 'Premium Queen/King Sized Bed with elegant design and superior quality materials.', 16081.00, NULL, NULL, NULL, '10701', NULL, 49, 10, 1, 1, '65', '200x200x45 cm', 'Particle Board with Laminate', '[\"king-queen-sized-bed-1-1.jpg\",\"king-queen-sized-bed-1-2.jpg\"]', '[\"king-queen-sized-bed-1-1.jpg\",\"king-queen-sized-bed-1-2.jpg\",\"king-queen-sized-bed-1-3.jpg\",\"king-queen-sized-bed-1-4.jpg\"]', 1, 1, NULL, NULL, 1, '{\"warranty\":\"2 years\",\"assembly_required\":true,\"material\":\"Particle Board with Laminate\",\"origin\":\"Philippines\",\"care_instructions\":\"Clean with dry cloth, avoid direct sunlight\",\"delivery_time\":\"3-5 business days\"}', '2025-10-19 11:03:04', '2025-10-19 11:03:06'),
(2, 1, 7, '[\"living-room\"]', 'Classic Pine Queen/King Sized Bed', 'classic-pine-queenking-sized-bed', 'A beautifully crafted Queen/King Sized Bed made from premium Ash Wood. This Classic Pine Queen/King Sized Bed features excellent craftsmanship and durability, perfect for any home. Designed with both style and functionality in mind, it will enhance your living space while providing years of reliable service.', 'Premium Queen/King Sized Bed with elegant design and superior quality materials.', 18063.00, NULL, NULL, NULL, '10702', NULL, 25, 10, 1, 1, '65', '200x200x45 cm', 'Ash Wood', '[\"king-queen-sized-bed-2-1.jpg\",\"king-queen-sized-bed-2-2.jpg\"]', '[\"king-queen-sized-bed-2-1.jpg\",\"king-queen-sized-bed-2-2.jpg\",\"king-queen-sized-bed-2-3.jpg\",\"king-queen-sized-bed-2-4.jpg\"]', 1, 1, NULL, NULL, 2, '{\"warranty\":\"2 years\",\"assembly_required\":true,\"material\":\"Ash Wood\",\"origin\":\"Philippines\",\"care_instructions\":\"Clean with dry cloth, avoid direct sunlight\",\"delivery_time\":\"3-5 business days\"}', '2025-10-19 11:03:04', '2025-10-19 11:03:06'),
